import { NextRequest, NextResponse } from "next/server";
import bcrypt from "bcryptjs";
import { PrismaClient } from "@prisma/client";

type UserRequest = {
  FirstName: string;
  LastName: string;
  Email: string;
  PhoneNumber: string;
  Password: string;
  Image: Buffer;
  ConfirmPassword: string;
};

const prisma = new PrismaClient();
export async function POST(req: NextRequest) {
  try {
    const {
      FirstName,
      LastName,
      Email,
      Password,
      ConfirmPassword,
      PhoneNumber,
      Image,
    } = (await req.json()) as UserRequest;

    // Input validation
    if (
      !FirstName ||
      !LastName ||
      !Email ||
      !Password ||
      !ConfirmPassword ||
      !PhoneNumber
    ) {
      return NextResponse.json(
        { error: "All fields are required" },
        { status: 400 }
      );
    }

    // Validate Password-ConfirmPassword
    if (Password !== ConfirmPassword) {
      return NextResponse.json(
        { error: "Password and ConfirmPassword do not match" },
        { status: 400 }
      );
    }

    // Check if the user already exists
    const existingUser = await prisma.users.findUnique({
      where: { Email },
    });

    if (existingUser) {
      return NextResponse.json(
        { error: "User with this email already exists" },
        { status: 400 }
      );
    }

    // Hash the password
    const hashedPassword = await bcrypt.hash(Password, 10);

    //#region [DefaultBase64Image]
    // Default Image
    const defaultImageBase64 =
      "";
    //#endregion

    // Convert the Base64 to Buffer
    const defaultImageBuffer = Buffer.from(defaultImageBase64, "base64");

    // Insert the new user into the database
    const newUser = await prisma.users.create({
      data: {
        FirstName,
        LastName,
        Email,
        Password: hashedPassword,
        PhoneNumber,
        Role: "admin",
        Image: Image || defaultImageBuffer,
      },
    });

    return NextResponse.json(
      {
        statusCode: 201,
        message: "Registration Successful.",
        data: {
          UserId: newUser.Id,
          UserName: newUser.FirstName + newUser.LastName,
          RegisteredAt: newUser.CreatedAt,
        },
      },
      { status: 201 }
    );
  } catch (error) {
    console.error("Error registering user:", error);
    return NextResponse.json(
      { message: "Internal server error" },
      { status: 500 }
    );
  }
}
